import object_hash from 'object-hash'
export default {
    state: {
        UPLOADING_LIST: {},//<- тут будет CANCEL_SOURCE, ERROR, PERCENTAGE, EXIF
    },
    getters: {
        ARRAY_UPLOADING_LIST: state => {
            const ls = state.UPLOADING_LIST;
            return Object.keys(ls).map(hash => { return { ...ls[hash], hash } })
        }
    },
    mutations: {
        SET_INSP_PHOTO(state, INSP_PHOTOS) {
            Vue.set(state, 'INSP_PHOTOS', INSP_PHOTOS)
        },
        PUSH_TO_UPLOADING_LIST(state, { file }) {
            const hash = object_hash({
                m: file.lastModified,
                n: file.name,
                s: file.size,
                t: file.type
            });
            if (hash in state.UPLOADING_LIST) return;
            this._vm.$set(state.UPLOADING_LIST, hash, {
                file,
                hash,
                base64: null,
                comment: '',
                ERROR: null,
                CANCEL_SOURCE: null,
                PERCENTAGE: null,
                EXIF: null
            });
        },
        REMOVE_FROM_UPLOADING_LIST(state, hash) {
            return Vue.delete(state.UPLOADING_LIST, hash)
        },

        SET_BASE64(state, { hash, base64 }) {
            Vue.set(state.UPLOADING_LIST[hash], 'base64', base64)
        },
        SET_CANCEL_SOURCE: (state, { CANCEL_SOURCE, hash }) => Vue.set(state.UPLOADING_LIST[hash], 'CANCEL_SOURCE', CANCEL_SOURCE),
        SET_PERCENTAGE: (state, { PERCENTAGE, hash }) => Vue.set(state.UPLOADING_LIST[hash], 'PERCENTAGE', PERCENTAGE),
        SET_UP_ERROR(state, { ERROR, hash }) {
            Vue.set(state.UPLOADING_LIST[hash], 'ERROR', ERROR)
        },
        SET_UP_COMMENT(state, { comment, hash }) {
            Vue.set(state.UPLOADING_LIST[hash], 'comment', comment)
        },
        SET_EXIF(state, { EXIF, hash }) {
            Vue.set(state.UPLOADING_LIST[hash], 'EXIF', EXIF)
        },
    },
    actions: {
        CHOOSE_PHOTO_HANDLER({ state, dispatch, commit, rootState }, files) {
            [...files].forEach(file => {
                if (file.type.indexOf("image") != -1)
                    commit('PUSH_TO_UPLOADING_LIST', { file })
                /*
                {
                    name: file.name,
                    size: file.size,
                    type: file.type,
                    url: window.URL.createObjectURL(file),
                    lastModifiedDate: file.lastModifiedDate.toLocaleString(),
                    comment: "",
                    fileSelf: file
                }
                */
                else {
                    swal.fire({
                        toast: true /*position: 'top-end',*/,
                        showConfirmButton: false,
                        timer: 5000,
                        title:
                            "This file is not a picture" +
                            ((name && `: <span class="text-red"> ${file.name}</span>`) || ""),
                        type: "warning"
                    });
                    console.warn("This file is not a picture: " + file.name + "!");
                }
            });

        },
        async UPLOAD_INSP_PHOTO({ state, dispatch, commit, rootState }, hash) {
            commit('SET_UP_ERROR', { hash, ERROR: false });
            "axios" in window ||
                (await import(/* webpackChunkName: "http" */ "../../http.js").then(
                    m => (window.axios = m.default)
                ));



            const cancelToken = axios.CancelToken;
            commit('SET_CANCEL_SOURCE', { hash, CANCEL_SOURCE: cancelToken.source() })
            const onUploadProgress = e => hash in state.UPLOADING_LIST && e.lengthComputable ? commit('SET_PERCENTAGE', { hash, PERCENTAGE: Math.round((e.loaded * 100.0) / e.total || 100) }) : ""

            const axios_config = {
                onUploadProgress,
                cancelToken: cancelToken.token,
                headers: {
                    'crossDomain': true,
                    // "content-type": "multipart/form-data",
                    'Content-Type': 'application/x-www-form-urlencoded',
                    "Access-Control-Allow-Origin": "*",
                }
            };
            const url = rootState.BASE_URL + "action=savepic";

            var config = { headers: { 'crossDomain': true, 'Content-Type': 'multipart/form-data', "Access-Control-Allow-Origin": "*", } }
            /*
            var base64 = `data:image/jpeg;base64,`;
            var ClientDate = '2019-08-29T08:11:04.183Z';
            var comment = 'postMANN!N!!';
            var hash = 'c7111b77641a5d8c27532e222d86024e5dd559e1'
            var insp_uid = 'F36DABE7-E191-43BC-9FE7-459D04603921';
            var def_uid = '9D91C651-60EE-4BB6-9743-095AA70A8EC8';
            var EXIF = null
            var DatePhotoFromBrowser = '2019-08-29T11:11:04';
            var info = '{"lastModified":1563868233809,"size":122212,"type":"image/jpeg"}';
            var formData = new FormData();
            formData.append(`base64`, base64)
            formData.append("comment", comment);
            formData.append("hash", hash);
            formData.append("insp_uid", insp_uid);
            formData.append("def_uid", def_uid);
            formData.append("EXIF", JSON.stringify(EXIF));
            axios.post(
                'https://apcis.tmou.org/develop/api/?api=picture-manager&action=savepic',
                formData,
                config
            ).then(e => console.log(e.data))
            */
            const obj = {};
            const e = state.UPLOADING_LIST[hash];
            if (e.base64) obj.base64 = e.base64
            // if pic is edited
            else obj.file = e.file

            const exif = e.EXIF
            obj.EXIF = exif && typeof exif == 'object' && Object.keys(exif).length > 0 && JSON.stringify(exif) || ''
            if (exif && 'DateTime' in exif)
                obj.DatePhoto = new Date(exif.DateTime.split(' ')[0].replace(/:/g, '.') + ' ' + exif.DateTime.split(' ')[1]).toISOString()

            if (exif && 'GPSDateStamp' in exif)
                obj.GPSDateStamp = new Date(exif.GPSDateStamp.replace(/:/g, '.')).toISOString()
            obj.ClientDate = new Date().toISOString()
            obj.comment = e.comment
            obj.hash = e.hash
            obj.insp_uid = rootState.insp_uid
            obj.def_uid = rootState.def_uid
            obj.DatePhotoFromBrowser = getStringDateToBase()
            try {
                obj.info = JSON.stringify({ lastModified: +new Date(e.file.lastModified || e.file.lastModifiedDate), size: e.file.size, type: e.file.type }).replace(/"/g, "'") // FIX BACKEND !! XML->MS SQL SERVER !
            } catch (e) { console.warn("file info err=>", e); throw e; }
            const formData = new FormData();
            Object.keys(obj).forEach(k => formData.append(k, obj[k]))
            axios
                .post(url, formData, config)
                .then(res => {
                    if (typeof res.data != "object") return commit('SET_UP_ERROR', { hash, ERROR: "Server didn't respond" })
                    else if (res.data.stat == 1) {
                        swal.fire({
                            toast: true,
                            type: 'success',
                            timer: 5000,
                            showConfirmButton: false,
                            title: `<b>${e.file.name} </b> &nbsp; was uploaded`
                        })
                        commit('REMOVE_FROM_UPLOADING_LIST', hash)
                    } else if (res.data.errors.length > 0) {
                        const ERROR = res.data.errors[0] || "An error has occurred";
                        commit('SET_UP_ERROR', { hash, ERROR })
                    }
                    dispatch('GET_INSP_PHOTOS')
                })
                .catch(error => {
                    if (axios.isCancel(error)) return swal.fire({//canceled
                        toast: true,
                        type: 'warning',
                        timer: 5000,
                        showConfirmButton: false,
                        title: 'Canceled by user!'
                    })
                    let title;
                    window.devMode && console.warn('error>', error);
                    if (error.response) {
                        // The request was made and the server responded with a status code
                        // that falls out of the range of 2xx
                        if (window.devMode) {
                            console.warn(error.response.data);
                            console.warn(error.response.status);
                            console.warn(error.response.headers);
                        }
                        title = error.response.data
                    } else if (error.request) {
                        // The request was made but no response was received
                        // `error.request` is an instance of XMLHttpRequest in the browser and an instance of
                        // http.ClientRequest in node.js
                        window.devMode && console.warn(error.request);
                        title = 'The request was made but no responce was received'
                    }
                    else {// Something happened in setting up the request that triggered an Error
                        window.devMode && console.warn("Error else => ", error.message);
                        title = error.message || error.message.msg
                    }
                    swal.fire({
                        toast: true,
                        type: 'warning',
                        timer: 5000,
                        showConfirmButton: false,
                        title
                    })
                    setTimeout(() => commit('SET_PERCENTAGE', { hash, PERCENTAGE: false }), 333)
                })
                .finally(() => hash in state.UPLOADING_LIST && commit('SET_CANCEL_SOURCE', { hash, CANCEL_SOURCE: false }))

        }
    },

}




function getStringDateToBase(dateval = new Date()) {
    const prefix = d => ("" + d).length > 1 && d || `0${d}`
    const Y = dateval.getFullYear()
    const M = dateval.getMonth() + 1
    const D = dateval.getDate()
    const h = dateval.getHours()
    const m = dateval.getMinutes()
    const s = dateval.getSeconds()

    let res = Y //year
    res += `-${prefix(M)}`//motnth
    res += `-${prefix(D)}`//Date
    res += `T${prefix(h)}`//hour
    res += `:${prefix(m)}`//min
    res += `:${prefix(s)}`//s
    return res
}